import React from "react";

const Contact = () => {
    return(
        <React.Fragment>
            <div className = "contact-div">
                <div className = "inner-contact-div"> 
                        <input type="text" placeholder="YOUR NAME *" /><br />
                        <input type="text" placeholder="YOUR EMAIL ID *" /><br />
                        <input type="textarea" placeholder="YOUR MESSAGE *" /><br />
                        <input type="button">Submit</input><br />

            </div>
            </div>
        </React.Fragment>
    );
}

export default Contact;
